function HeaderHtml(props) {
    return (
        <div className="header">
            <h1>{props.title}</h1>
            <img src="https://upload.wikimedia.org/wikipedia/commons/6/61/Smcc_logo.gif"  alt="smcc logo" className="header-logo"/>
        </div>
    )
}

export default HeaderHtml;
